import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/features/Header/Header';
import HomePage from './components/pages/HomePage/HomePage';
import ServicePage from './components/pages/ServicePage/ServicePage';
import ServicesPage from './components/pages/ServicePage/ServicePage';
import CatalogPage from './components/pages/CatalogPage/CatalogPage'; // Імпортуйте компонент каталогу
import DoctorPage from './components/pages/DoctorPage/DoctorPage';

const App: React.FC = () => {
  return (
    <Router>
      <div className="app">
        <Header />
        <main>
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/catalog" element={<CatalogPage />} /> {/* Додайте маршрут до каталогу */}
            <Route path="/service/:id" element={<ServicePage />} />

            <Route path="/services" element={<ServicesPage />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
};

export default App;
